function ChatBar(){
    return(
        <div className="chat__sidebar">
            <h2>Open Chat</h2>

            <p>logged in as: </p>{localStorage.userName}
            <div>
                <h4 className="chat__header">ACTIVE USERS</h4>
                <div className="chat__users">
                    <p>User 1</p>
                    <p>User 2</p>
                    <p>User 3</p>
                </div>
            </div>
        </div>
    )
}

export default ChatBar;
